/** Variable para almacenar la conversión ADC del PAD A (12 bits) */
static uint16_t valor_adc_A = 0;

/** Variable para almacenar la conversión ADC del PAD B (12 bits) */
static uint16_t valor_adc_B = 0;

/** Variable para almacenar los milivots registrados */
static uint32_t milliv_A = 0;

/** Variable para almacenar los milivots registrados */
static uint32_t milliv_B = 0;

/*==================[internal functions declaration]=========================*/
/**
 * @brief Callback del timer A - dispara conversión ADC cada 50μs (20kHz)
 */
void TimerAdcCallback(void *param);

/**
 * @brief Tarea que procesa y transmite datos del ADC
 */
static void AdcTask(void *pvParameters);


/**
 * @brief Tarea que compara el valor del ADC con un umbral y reproduce audio si se supera
 */
static void UmbralTask(void *pvParameters);


/**
 * @brief Tarea que realiza el bucle for que recorre el arreglo de audio para el PAD A
 */
static void SonarATask(void *pvParameters);


/**
 * @brief Tarea que realiza el bucle for que recorre el arreglo de audio para el PAD B
 */
static void SonarBTask(void *pvParameters);

/*==================[external functions definition]==========================*/

void TimerAdcCallback(void *param) {

    vTaskNotifyGiveFromISR(adc_task_handle, NULL);

}

static void SonarATask(void *pvParameters) {
 
    while (true) {
     ulTaskNotifyTake(pdTRUE, portMAX_DELAY);

     //PAD A AUDIO
    
    for(int i = 0; i < sizeof(snare_drum1); i++){
        AnalogOutputWrite(snare_drum1[i]);
        vTaskDelay(pdMS_TO_TICKS(1000 / SAMPLE_RATE)); // Ajusta el retardo según la frecuencia de muestreo
     }
    
    }
}

static void SonarBTask(void *pvParameters) {
 
    while (true) {
     ulTaskNotifyTake(pdTRUE, portMAX_DELAY);

     //PAD B AUDIO
    
    for(int i = 0; i < sizeof(Hi_Hat1); i++){
        AnalogOutputWrite(Hi_Hat1[i]);
        vTaskDelay(pdMS_TO_TICKS(1000 / SAMPLE_RATE)); // Ajusta el retardo según la frecuencia de muestreo
     }
    
    }
}

static void AdcTask(void *pvParameters) {
    while (1) {

        ulTaskNotifyTake(pdTRUE, portMAX_DELAY);
        // Lee el conversor ADC 
        AnalogInputReadSingle(ADC_CHANNEL_A, &valor_adc_A);
        //AnalogInputReadSingle(ADC_CHANNEL_B, &valor_adc_B);
        
        // Mejor enviar como entero (mV) para reducir uso de stack y evitar float en sprintf
        milliv_A = (uint32_t)((valor_adc_A * 3300UL) / 4095UL);
       // milliv_B = (uint32_t)((valor_adc_B * 3300UL) / 4095UL);
       
        char buffer_A[32];
        //char buffer_B[32];

        // Formato: "1234\r\n"
        sprintf(buffer_A, "%lu\r\n", (unsigned long)milliv_A);
        //sprintf(buffer_B, "%lu\r\n", (unsigned long)milliv_B);
        UartSendString(UART_PC, buffer_A);
        //UartSendString(UART_PC, buffer_B);
        
         /*
        char buffer[64];
        int len = sprintf(buffer, "%lu,%lu\r\n", (unsigned long)milliv_A, (unsigned long)milliv_B);
        UartSendString(UART_PC, buffer);
        */
        //APLICO EL UMBRAL

        if (milliv_A > ADC_THRESHOLD_MV_MINIMUM) {
            vTaskNotifyGiveFromISR(umbral_task_handle, NULL);
            vTaskNotifyGiveFromISR(sonarA_task_handle, NULL);
            vTaskDelay(pdMS_TO_TICKS(100)); 
        } 
        /*
        if (milliv_B > ADC_THRESHOLD_MV_MINIMUM) {
            vTaskNotifyGiveFromISR(umbral_task_handle, NULL);
            vTaskNotifyGiveFromISR(sonarB_task_handle, NULL);
            vTaskDelay(pdMS_TO_TICKS(100)); 
        }
        */

    }
}
/**
 * @brief Tarea que monitorea el valor del ADC y reproduce sonido (o activa pin)
 * cuando se supera el umbral configurado.
 }*/
static void UmbralTask(void *pvParameters) {

    while(true){
        ulTaskNotifyTake(pdTRUE, portMAX_DELAY);
        NeoPixelAllColor(NEOPIXEL_COLOR_RED);   
        vTaskDelay(pdMS_TO_TICKS(125)); 
        NeoPixelAllOff(); 
    }
}

void app_main(void) {

    analog_input_config_t adc_config_A = {
        .input = ADC_CHANNEL_A,   // Canal CH1 para PAD A
        .mode = ADC_SINGLE,     // Conversión individual
        .func_p = NULL,         
        .param_p = NULL,
        .sample_frec = 0        
    };
        analog_input_config_t adc_config_B = {
        .input = ADC_CHANNEL_B,   // Canal CH0 para PAD B
        .mode = ADC_SINGLE,     // Conversión individual
        .func_p = NULL,         
        .param_p = NULL,
        .sample_frec = 0        
    };
//

    // Inicialización UART 
   serial_config_t uart_config = {
        .port = UART_PC,
        .baud_rate = UART_BAUD_RATE,
        .func_p = NULL,         
        .param_p = NULL
    };
    // Configuración timer A para muestreo ADC (20kHz)
    timer_config_t timer_adc_config = {
        .timer = TIMER_A,
        .period = TIMER_ADC_PERIOD_US,  // Cada 50μs = 20kHz
        .func_p = TimerAdcCallback,     // Callback para lectura ADC
        .param_p = NULL
    };

    
    neopixel_color_t LED_UNICO;
    TimerInit(&timer_adc_config);
    AnalogInputInit(&adc_config_A);
    AnalogInputInit(&adc_config_B);
    AnalogOutputInit();
    UartInit(&uart_config);
    NeoPixelInit(BUILT_IN_RGB_LED_PIN ,  BUILT_IN_RGB_LED_LENGTH ,  &LED_UNICO );
    
    
    // Crear tareas
    xTaskCreate(AdcTask, "AdcTask", 4096, NULL, 5, &adc_task_handle);
    xTaskCreate(SonarATask, "SonarATask", 4096, NULL, 5, &sonarA_task_handle);
    xTaskCreate(SonarBTask, "SonarBTask", 4096, NULL, 5, &sonarB_task_handle);
    xTaskCreate(UmbralTask, "UmbralTask", 4096, NULL, 5, &umbral_task_handle);
    
    
    TimerStart(TIMER_A); 
    
}

